import React , {Component} from 'react';
import axios from 'axios';

class VehicleReg extends Component{
    constructor(props){
        super(props)
        this.state ={
            vehicleNo : '',
            contactNo  :'',
            beginingDate : '',
            endingDate : '',
            seatsNo:'',
            onlyVehicle : '',
            ppkm : '',
            vehicleModel : '',
            locations : '',
            vehicleImage : '',
            day: '',
            month: '',
            year: '',
            current: '',
            currentplus: '',
            start: '',
            end: ''

        }
        this.onChange = this.onChange.bind(this)
        // this.onSubmit = this.onSubmit.bind(this)
        // this.logintosupplier = this.logintosupplier.bind(this);
        this.vehiRegister = this.vehiRegister.bind(this);
    }
    getDate() {
        const now = new Date();
        
        if(this.state.month<10){
            // eslint-disable-next-line
            this.state.current = now.getFullYear()+'-0'+(now.getMonth()+1)+"-"+now.getDate();
            // eslint-disable-next-line
            this.state.currentplus = now.getFullYear()+'-0'+(now.getMonth()+1)+"-"+(now.getDate()+1);
        }else{
            // eslint-disable-next-line
            this.state.current = now.getFullYear()+'-'+(now.getMonth()+1)+"-"+now.getDate();
            // eslint-disable-next-line
            this.state.currentplus = now.getFullYear()+'-'+(now.getMonth()+1)+"-"+(now.getDate()+1);
        }
        console.log(this.state.current);
    }
    getEnteredDate() {
        if(this.state.month<10){
            // eslint-disable-next-line
            this.state.start = this.state.beginingDate.getFullYear()+'-0'+(this.state.beginingDate.getMonth()+1)+"-"+this.state.beginingDate.getDate();
            // eslint-disable-next-line
            this.state.end = this.state.beginingDate.getFullYear()+'-0'+(this.state.beginingDate.getMonth()+1)+"-"+(this.state.beginingDate.getDate()+1);
        }else{
            // eslint-disable-next-line
            this.state.start = this.state.beginingDate.getFullYear()+'-'+(this.state.beginingDate.getMonth()+1)+"-"+this.state.beginingDate.getDate();
            // eslint-disable-next-line
            this.state.end = this.state.beginingDate.getFullYear()+'-'+(this.state.beginingDate.getMonth()+1)+"-"+(this.state.beginingDate.getDate()+1);
        }
        console.log(this.state.current);
    }
    componentDidMount() {
        this.getDate();
    }
   onChange(e){
       this.setState({[e.target.name]:e.target.value})
   }
//    onSubmit(e){
//        e.preventDefault()

//        const user ={
//            vehicleNo:this.state.vehicleNo,
//            contactNo:this.state.contactNo,
//            beginingDate:this.state.beginingDate,
//            endingDate:this.state.endingDate,
//            seatsNo:this.state.seatsNo,
//            onlyVehicle : this.state.onlyVehicle,
//            ppkm : this.state.ppkm,
//            vehicleModel : this.state.vehicleModel,
//            locations : this.state.locations,
//            vehicleImage : this.state.vehicleImage,
//         //    selectedFile:this.state.selectedFile
//        }
//        register(user).then(res => {
           
//                this.props.history.push('/supplier-login')
           
//        })
//    }
   vehiRegister(e){
    e.preventDefault();
    this.getEnteredDate();
    const obj = {
        vehicleNo : this.state.vehicleNo,
        contactNo  :this.state.contactNo,
        beginingDate : this.state.start,
        endingDate : this.state.endDate,
        seatsNo:this.state.seatsNo,
        onlyVehicle : this.state.onlyVehicle,
        ppkm : this.state.ppkm,
        vehicleModel : this.state.vehicleModel,
        locations : this.state.locations,
        // vehicleImage : '',
   };
   axios.post( 'http://localhost:4000/vehicle/add/',obj )
       .then(res => {
                if(res){
                    alert("added successfully")
                    // this.props.history.push('/supplier')
                }else{
                    alert("failed")
                }
            })
   }
//    logintosupplier(e){
//      this.props.history.push('/supplier-login')
//    }
//    state={
//        selectedFile:null
//    }
//    fileSelectedHandler = event =>{
//        this.setState({
//            selectedFile:event.target.files[0]
//        })
//    }
//    fileUploadedHandler = () =>{
//         axios.post('http://');
//    }

    render(){
        return(
            <div className ="bg-img">
                {/* <div className ="container"> */}
                <div className ="row">
                    <div className ="col-md-6 mt-5 mx-auto">
                        <form className = "form-container" noValidate onSubmit ={this.onSubmit}> 
                            
                            <h1 className ="h3 mb-3 font-weight-normal">Please sign in</h1>
                            <div className="row">
                                <div className="col-lg-6">
                                <label htmlFor = "vehicleNo">Vehicle Number</label>
                                    <input type ="text"
                                        className="form-control"
                                        name = "vehicleNo"
                                        placeholder ="Enter first name"
                                        value ={this.state.vehicleNo}
                                        onChange ={this.onChange}
                                
                                    />
                                </div>
                            
                                <div className="col-lg-6">
                                <label htmlFor = "contactNo">Contact Number </label>
                                    <input type ="text"
                                        className="form-control"
                                        name = "contactNo"
                                        placeholder ="Enter Contact Number"
                                        value ={this.state.contactNo}
                                        onChange ={this.onChange}
                                
                                    />
                                </div>
                            </div>
                            {/* <div className="row">
                                            <div className="col-lg-6">
                                                <label htmlFor="start"><small>Pick-up Date</small></label>
                                                <input type="date" className="form-control" name="start" onChange={this.onChange} value={this.state.start} min={this.state.current}/>
                                            </div> 
                                            <div className="col-lg-6">
                                                <label htmlFor="start"><small>Drop-off Date</small></label>
                                                <input type="date" className="form-control" name="end" onChange={this.onChange} value={this.state.end} min={this.state.currentplus}/>
                                            </div>
                                        </div><br/>  */}
                            <div className="row">
                                        <div className="col-lg-6">
                                            <label htmlFor = "begingdate">Begining Date of Availability</label>
                                            <input type="date"
                                                   //placeholder="Begining Date of Availability" 
                                                   className="form-control" 
                                                   name="beginingDate" 
                                                   value={this.state.beginingDate}
                                                   onChange={this.onChange}
                                                   min={this.state.current}
                                            />  
                                        </div> 
                                        <div className="col-lg-6">
                                            <label htmlFor = "endingate">Ending Date of Availability</label>
                                            <input type="date"
                                                   //placeholder="Ending Date of Availability" 
                                                   className="form-control" 
                                                   name="endingDate" 
                                                   min={this.state.currentplus}
                                                   value={this.state.endingDate}
                                                   onChange={this.onChange}
                                            />
                                        </div>
                            </div><br/>
                            <div className ="row">
                                <div className="col-lg-6">
                                    <label className="radio-inline">
                                        <input type="radio" 
                                            value="driver"
                                            name="onlyVehicle" 
                                            checked={this.state.onlyVehicle === "driver"} 
                                            onChange={this.onChange}
                                            //noValidate
                                        />
                                        With Driver
                                    </label>
                                </div>
                                <div className="col-lg-6">
                                    <label className="radio-inline">
                                        <input type="radio" 
                                            value="nodriver" 
                                            checked ={this.state.onlyVehicle === "nodriver"}
                                            name="onlyVehicle" 
                                            onChange={this.onChange}
                                            //noValidate
                                        />
                                        WithOut Driver
                                    </label>
                                </div>
                            </div><br/>
                            <div className ="row">
                                
                                <div className="col-lg-6">
                                    {/* <label htmlFor = "sheet_num">Number of Sheet </label> */}
                                    <input type ="text"
                                            className="form-control"
                                            //className={formErrors.sheet_num.length >0 ? "error" :null}
                                            name = "seatsNo"
                                            placeholder ="Enter Number of Seat"
                                            value ={this.state.seatsNo}
                                            onChange ={this.onChange}
                                            //noValidate
                                    
                                    />
                                    {/* {formErrors.sheet_num.length>0 && (
                                        <span className="errorMessage">{formErrors.sheet_num}</span>
                                    )} */}
                                </div>
                                <div className="col-lg-6">
                                    {/* <label htmlFor = "pay_per_onekm">Pay per one km</label> */}
                                    <input type ="text"
                                            className="form-control"
